  useEffect(() => {
    fetch(BASE_URL)
      .then(res => res.json())
  }, [])
  return (
    <>
      <h1>Convert</h1>
      <CurrencyRow />
      <div className="equals">=</div>
      <CurrencyRow />
    </>
  );
}

